class Solution(object):
    def sumSubarrayMins(self, A):
        """
        :type A: List[int]
        :rtype: int
        """
        stack,res,i = [0],0,1
        while i < len(A):
            if A[i] <= A[i-1]:
                r=i
                while stack:
                    c = stack.pop()
                    if stack: l = stack[-1] + 1
                    else: l = 0
                    #print 'l',l,'r',r, ' c ', c
                    res += A[c]*(1 + c-l + r-c-1 + (c-l)*(r-c-1))
                    if stack and A[stack[-1]] < A[i]: break
            stack.append(i)
            i += 1
        #print stack
        r = len(A)
        while stack:
            c = stack.pop()
            if stack: l = stack[-1] + 1
            else: l = 0
            #print 'l',l,'r',r, ' c ', c
            res += A[c]*(1 + c-l + r-c-1 + (c-l)*(r-c-1))

        return res % 1000000007

